import React, { Component } from "react";
import PostData from "./bio.json";
class App extends Component {
  render() {
    return (
      <div>
        {PostData.map((postDetail, index) => {
          return <p>{postDetail.title}</p>;
        })}
      </div>
    );
  }
}

export default App;
